import React, { useEffect } from 'react';

function Home() {
  useEffect(() => {
    fetch('http://localhost:3000/posts') 
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then((data) => {
        console.log(data); 
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Homepage</h1>
    </div>
  );
}

export default Home;
